    async function fetchAndDisplayQuestionFromGraph(displayed_contracts, ranking) {
        //console.log('fetchAndDisplayQuestionFromGraph', displayed_contracts, ranking);

        var ts_now = parseInt(new Date() / 1000);
        var contract_str = JSON.stringify(displayed_contracts);
        var ranking_where = {
            'questions-active-answered': '{contract_in: ' + contract_str + ', isPendingArbitration: false, answerFinalizedTimestamp_gt: ' + ts_now + ', openingTimestamp_lte: ' + ts_now + '}',
            'questions-active-unanswered': '{contract_in: ' + contract_str + ', isPendingArbitration: false, answerFinalizedTimestamp: null, openingTimestamp_lte: ' + ts_now + '}',
            'questions-upcoming': '{contract_in: ' + contract_str + ', isPendingArbitration: false, openingTimestamp_gt: ' + ts_now + '}',
            'questions-resolved': '{contract_in: ' + contract_str + ', answerFinalizedTimestamp_lt: ' + ts_now + '}',
            'questions-awaiting-arbitration': '{contract_in: ' + contract_str + ', isPendingArbitration: true}'
        };

        var ranking_order = {
            'questions-active-answered': 'lastBond',
            'questions-active-unanswered': 'createdTimestamp',
            'questions-upcoming': 'createdTimestamp',
            'questions-resolved': 'answerFinalizedTimestamp',
            'questions-awaiting-arbitration': 'lastBond'
        };

        var where = ranking_where[ranking];
        var orderBy = ranking_order[ranking];

        var network_graph_url = CHAIN_INFO.graphURL;
        if (!network_graph_url) {
            console.log('No graph endpoint found for this network, skipping graph fetch');
            return false;
        }
        // console.log('graph url is ', network_graph_url);

        var query = '\n      {\n        questions(first: 10, where: ' + where + ', orderBy: ' + orderBy + ', orderDirection: desc) {\n            id,\n            questionId,\n            contract,\n            createdBlock\n        }\n      }  \n      ';

        // console.log('sending graph query', ranking, query);
        var res = await axios.post(network_graph_url, { query: query });
        // console.log('graph res', ranking, res.data);
        var _iteratorNormalCompletion2 = true;
        var _didIteratorError2 = false;
        var _iteratorError2 = undefined;

        try {
            for (var _iterator2 = res.data.data.questions[Symbol.iterator](), _step2; !(_iteratorNormalCompletion2 = (_step2 = _iterator2.next()).done); _iteratorNormalCompletion2 = true) {
                var q = _step2.value;

                var question_posted = RCInstance(q.contract).filters.LogNewQuestion(q.questionId);
                var result = await RCInstance(q.contract).queryFilter(question_posted, parseInt(q.createdBlock), parseInt(q.createdBlock));
                for (var i = 0; i < result.length; i++) {
                    handlePotentialUserAction(result[i], false);
                    handleQuestionLog(result[i]);
                }
            }
        } catch (err) {
            _didIteratorError2 = true;
            _iteratorError2 = err;
        } finally {
            try {
                if (!_iteratorNormalCompletion2 && _iterator2.return) {
                    _iterator2.return();
                }
            } finally {
                if (_didIteratorError2) {
                    throw _iteratorError2;
                }
            }
        }
    }

    async function fetchAndDisplayQuestionsFromLogs(contract, end_block, fetch_i) {

        // get how many to fetch off fetch_numbers, until we run off the end then use the last num
        var fetch_num = fetch_i < FETCH_NUMBERS.length ? FETCH_NUMBERS[fetch_i] : FETCH_NUMBERS[FETCH_NUMBERS.length - 1];

        var start_block = end_block - fetch_num;
        if (start_block < RCStartBlock(contract)) {
            start_block = RCStartBlock(contract);
        }
        if (end_block <= RCStartBlock(contract)) {

            console.log('History read complete back to block', RCStartBlock(contract));

            IS_INITIAL_LOAD_DONE = true;
            window.setTimeout(reflectDisplayEntryChanges, 10000);
            $('body').addClass('initial-loading-done');

            scheduleFallbackTimer();
            runPollingLoop(RCInstance(contract));

            //$('body').addClass('is-page-loaded');

            return;
        }

        //console.log('fetchAndDisplayQuestionsFromLogs', start_block, end_block, fetch_i);

        var question_posted = RCInstance(contract).filters.LogNewQuestion();
        var result = await RCInstance(contract).queryFilter(question_posted, start_block, end_block);
        /* 
        if (error === null && typeof result !== 'undefined') {
        */
        for (var i = 0; i < result.length; i++) {
            if (result[i].invalid_data) {
                continue;
            }
            handlePotentialUserAction(result[i], false);
            handleQuestionLog(result[i]);
        }
        /*
        } else {
            console.log(error);
        }
        */

        if (fetch_i % 100 == 0) {
            console.log('fetch range (output will skip the next 99 fetches)', contract, start_block, end_block, fetch_i);
        }
        fetchAndDisplayQuestionsFromLogs(contract, start_block - 1, fetch_i + 1);
    }

